- uid: SuperOffice.WebApi.Data.DocumentEntity.ExtraFields
  commentId: P:SuperOffice.WebApi.Data.DocumentEntity.ExtraFields
  id: ExtraFields
  parent: SuperOffice.WebApi.Data.DocumentEntity
  langs:
  - csharp
  - vb
  name: ExtraFields
  nameWithType: DocumentEntity.ExtraFields
  fullName: SuperOffice.WebApi.Data.DocumentEntity.ExtraFields
  type: Property
  source:
    path: SuperOffice.WebApi
    isExternal: true
  assemblies:
  - SuperOffice.WebApi
  namespace: SuperOffice.WebApi.Data
  summary: "\nDeprecated: Use <xref href=\"SuperOffice.WebApi.Data.DocumentEntity.CustomFields\" data-throw-if-not-resolved=\"false\"></xref> instead.\nExtra fields added to the carrier. This could be data from Plug-ins, the foreign key system, external applications, etc.\nThe value string is the encoded value: &quot;[I:123]&quot; or &quot;[DT:2019-09-11]&quot;.\n"
  remarks: "\nThe naming convention of the key string is as follows:\n<table><tbody><tr><td>Plug-in data</td><td>\n	[Plug-in name].[Property name]\n	Example: DocumentPlugin.DocumentType\n</td></tr><tr><td>Foreign key data</td><td>\nThe device identity is appended directly to the device name if it exists. \n   This is not commonly used, but the database opens for this as a possibility to have several devices with the same name, \n   and hence we would ensure an unique key if this field is used.\n   Example: Audience.SecretService.DefaultCountry\n</td></tr><tr><td>User defined table data</td><td>\n[Table name].[Field name]\nExample: Phunneling.AggregatedSales\n</td></tr><tr><td>Other</td><td>\nOther data sources must ensure an unique name. If the key already exists we do not add the data to the dictionary. \nWe also ensure that SuperOffice data are added first, so that existing data doesnt change when more data sources are added (with duplicate data keys).\n</td></tr></tbody></table>\n"
  syntax:
    content: public virtual StringDictionary ExtraFields { get; set; }
    parameters: []
    return:
      type: SuperOffice.WebApi.Data.StringDictionary
    content.vb: Public Overridable Property ExtraFields As StringDictionary
  overload: SuperOffice.WebApi.Data.DocumentEntity.ExtraFields*
  modifiers.csharp:
  - public
  - virtual
  - get
  - set
  modifiers.vb:
  - Public
  - Overridable
